export default {
  data() {
    return {
      show: false,
      form: this.$form.createForm(this)
    }
  },
  props: {
    name: {
      type: String,
      default: ''
    },
    age: {
      type: Number,
      default: 0
    }
  },
  mounted() {
    this.$nextTick(() => {
      this.setFieldsValue()
    })
  },
  methods: {
    setFieldsValue() {
      this.form.setFieldsValue({
        age: this.age
      })
    }
  }
}
